import React from "react";
import { Grid } from "@material-ui/core";
function FormulaBar() {
  return (
    <Grid container direction="row" justifyContent="space-between">
      <Grid>Fx:</Grid>
      <Grid justify-xs-flex-end="true">Expand Formula</Grid>
    </Grid>
  );
}

export default FormulaBar;
